import React from 'react';

const Card = ({ name, email, id }) => {
	return ( 
		<div className='tc grow bg-gray br3 pa3 ma2 dib bw2 shadow-5'>
			<img alt='robots' src={'https://robohash.org/brodie'}/> 
			<img alt='robots' src={'https://robohash.org/slade'}/>
			<img alt='robots' src={'https://robohash.org/craig'}/>
			<img alt='robots' src={'https://robohash.org/janine'}/>
			<img alt='robots' src={'https://robohash.org/robyn'}/>
			<img alt='robots' src={'https://robohash.org/duegan'}/>
			<img alt='robots' src={'https://robohash.org/courtenay'}/>
			<img alt='robots' src={'https://robohash.org/jamin'}/>
			<img alt='robots' src={'https://robohash.org/sabrina'}/>
			<div>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}

export default Card;
